import React, { Component } from "react";
import { Link } from "react-router-dom";

class Details extends Component {
  state = {
    user_data: null,
  };

  componentDidMount() {
    const { user } = this.props.location.state;
    this.setState({ user_data: user });
  }

  render() {
    return (
      <div className="App">
        <h1>Project Home</h1>
        {this.state.user_data && <p>{this.state.user_data.gender}</p>}
        {/* Link to List.js */}
        <Link to={"../"}>
          <button variant="raised">Go Back</button>
        </Link>
      </div>
    );
  }
}
export default Details;
